import * as React from 'react';

class MyInput extends React.Component {
    onChange() {
        console.log("changed");
    }

    onBlur() {
        console.log("blurred");
    }

    render() {
        return <input onChange={this.onChange} onBlur={this.onBlur}/>;
    }
}

export default MyInput;
